import classes from './NavBar.module.css';

const NavBar = () => {
  return (
    <div className={classes.navbar}>
      <header>Wave Challenge</header>
      <div className={classes.topnav}>
        <a>Invoicing</a>
        <a>Customers</a>
      </div>
    </div>
  );
};

export default NavBar;
